--
-- Procedimientos
--
CREATE DEFINER=`id19574679_userley`@`%` PROCEDURE `registrar_consumo` (IN `_idusuario` INT, IN `_idmes` INT, IN `_idanio` INT, IN `_consumorecibo` DECIMAL(10,2), IN `_montorecibo` DECIMAL(10,2), IN `_consumokwtotal` DECIMAL(10,2), IN `_precioxkw` DECIMAL(10,4), IN `_costoadministrativo` DECIMAL(10,2), IN `_costoadministrativototal` DECIMAL(10,2), IN `_costofraccionamiento` DECIMAL(10,2), IN `_costofraccionamientototal` DECIMAL(10,2), IN `_igv` DECIMAL(10,2))  BEGIN

SET @exist = (SELECT idconsumo FROM consumo WHERE idmes = _idmes AND idanio = _idanio);

SET @idConsumo = 0;

 IF EXISTS(SELECT idconsumo FROM consumo WHERE idmes = _idmes AND idanio = _idanio) THEN

	SET @idConsumo = (SELECT idconsumo FROM consumo WHERE idmes = _idmes AND idanio = _idanio);
	
ELSE
	
	INSERT INTO consumo 
	(idmes,idanio,consumokwtotal,precioxkw,costoadministrativo,costofraccionamiento,costototalconsumo,igv)
	VALUES
	(_idmes,_idanio,_consumorecibo,_precioxkw,_costoadministrativototal,_costofraccionamientototal,_montorecibo,_igv);

	SET @idConsumo = LAST_INSERT_ID();

END IF; 


SET @dato  = (_consumokwtotal - (SELECT MAX(medidakw) FROM consumo_detalle WHERE consumo_detalle.idusuario = _idusuario));

INSERT INTO consumo_detalle
(idusuario, idmes, idanio,medidakw, 
	costokw, igv, consumokw, montototalsinigv, 
	montoigv, montototalconigv, montocostoadministrativo, 
	montopagofraccionado, montototal, idconsumo)
VALUE
(_idusuario, _idmes, _idanio, _consumokwtotal, 
	_precioxkw, (_igv/100), @dato, (@dato * _precioxkw), 
	((@dato * _precioxkw)*(_igv/100)),((@dato * _precioxkw)*(1+(_igv/100))),_costoadministrativo,
	_costofraccionamiento,(((@dato * _precioxkw)*(1+(_igv/100))) + _costoadministrativo + _costofraccionamiento),	@idConsumo);


SET @totalkwconsumido = (SELECT SUM(consumokw) FROM consumo_detalle WHERE consumo_detalle.idusuario != 4 AND consumo_detalle.idmes = _idmes AND consumo_detalle.idanio = _idanio);
SET @totalmonto = (SELECT SUM(montototal) FROM consumo_detalle WHERE consumo_detalle.idusuario != 4 AND consumo_detalle.idmes = _idmes AND consumo_detalle.idanio = _idanio);


IF (_idusuario = 4) THEN

SET @consumidokw = _consumorecibo - @totalkwconsumido;
SET @montopago = _montorecibo - @totalmonto;

	UPDATE consumo_detalle
	SET 
		consumokw = @consumidokw, 
		montototalsinigv = @consumidokw * costokw, 
		montoigv = (@consumidokw * costokw) * igv, 
		montototalconigv = (@consumidokw * costokw) * (1+igv), 
		montototal = @montopago 
	WHERE consumo_detalle.idusuario = _idusuario AND consumo_detalle.idmes = _idmes AND consumo_detalle.idanio = _idanio;

END IF;


END$$

